import React from "react";

import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Projects from "./pages/Projects";


const AppRoutes = () => {
    return (
        <Routes>
            <Route path="/projects" element={Projects}></Route>
        </Routes>
    );
}

export default AppRoutes;
